// Constants
const d = 256; // Number of characters in the input alphabet

// Function to calculate rolling hash for the entire text
function calculateTextHashes(txt, patternLength, q) {
    const N = txt.length;
    const hashes = new Array(N - patternLength + 1);
    let h = 1;
    let hash = 0;

    // Calculate the hash multiplier
    for (let i = 0; i < patternLength - 1; i++) {
        h = (h * d) % q;
    }

    // Calculate initial hash for the first window
    for (let i = 0; i < patternLength; i++) {
        hash = (d * hash + txt[i].charCodeAt()) % q;
    }
    hashes[0] = hash;

    // Calculate hash for remaining windows
    for (let i = 1; i <= N - patternLength; i++) {
        hash = (d * (hash - txt[i - 1].charCodeAt() * h) + txt[i + patternLength - 1].charCodeAt()) % q;
        if (hash < 0) {
            hash += q;
        }
        hashes[i] = hash;
    }

    return hashes;
}

// Function to calculate hash for the pattern
function calculatePatternHash(pattern, q) {
    let hash = 0;
    for (let i = 0; i < pattern.length; i++) {
        hash = (d * hash + pattern[i].charCodeAt()) % q;
    }
    return hash;
}

// Function to perform Rabin-Karp search with precomputed text hashes
function searchWithPrecomputedHash(pat, txt, q) {
    const M = pat.length;
    const N = txt.length;
    const patHash = calculatePatternHash(pat, q);
    const start = performance.now();
    const txtHashes = calculateTextHashes(txt, M, q);
    const end = performance.now();
    console.log(`Precomputed hashes in ${end - start} ms`);

    const start2 = performance.now();
    for (let i = 0; i <= N - M; i++) {
        if (patHash === txtHashes[i]) {
            let j;
            for (j = 0; j < M; j++) {
                if (txt[i + j] !== pat[j]) {
                    break;
                }
            }
            if (j === M) {
                console.log(`Pattern found at index ${i}`);
            }
        }
    }
    const end2 = performance.now();
    console.log(`Search completed in ${end2 - start2} ms`);
}
